import React, { useState } from 'react';

import './app.css'

import Main from './components/main';


const App = () => {

  const [headerToggle, setHeaderToggle] = useState(false)
  const [headerButton, setHeaderButton] = useState("")

  const headerButtonToggled = (clicked) => {
    setHeaderToggle(clicked)
    console.log(clicked)
  }

  const headerButtonPressed = (clicked) => {
    setHeaderButton(clicked)
    console.log(clicked)
  }

  return (
    <div>
      <Main
        headerToggle={headerToggle} 
        headerButtonToggled={headerButtonToggled}
        headerButton ={headerButton}
        headerButtonPressed = {headerButtonPressed}
        />
    </div>
  )
}

export default App;
